import React from "react";
import { Tab, Tabs, TabList, TabPanel } from "react-tabs";
function ContentPage() {
  return (
    <Tabs>
      <TabList>
        <Tab>프로젝트</Tab>
        <Tab>활동</Tab>
        <Tab>기타</Tab>
        <Tab>프로필</Tab>
      </TabList>

      <TabPanel>
        <h2>Any content 1</h2>
      </TabPanel>
      <TabPanel>
        <h2>Any content 2</h2>
      </TabPanel>
    </Tabs>
  );
}

export default ContentPage;
